import Home from './Pages/Home'
import Nav from './Components/Nav';
import './App.css';
import { Routes, Route } from "react-router-dom";
function App() {
  return (
    <div>
      <Routes>
      <Route path="/" element={<Home/>} />
      </Routes>
      <Nav/>

    </div>
  );
}

export default App;
